import React from 'react';
import { useHistory } from "react-router-dom";

function Home() {
  const history = useHistory();
  
  const handleRoute = () =>{ 
    history.push("/Sample");
  }
  
  return (                     
    <React.Fragment>
    <form onSubmit={this.onSubmitHandler}>
         <h1>Hello</h1>
         <input type="submit"/>
    </form>

</React.Fragment>
  );
}
export default Home;
